import { Container } from "@material-ui/core";

const Footer = () => {
  return (
    <Container>
      <footer
        style={{
          height: "60px",
          width: "100%",
          borderTop: "1px solid #e6e6e6"
        }}
      >
        <style>{`
                    footer li{text-transform: uppercase; color:#888}
                    footer ul{
                        display: flex;
                        list-style: none;
                        justify-content: space-between;
                    }
                `}</style>
        <ul>
          <li><small>about</small></li>
          <li><small>careers</small></li>
          <li><small>mobile apps</small></li>
          <li><small>professionals</small></li>
          <li><small>buttons</small></li>
          <li><small>advertise</small></li>
          <li><small>sell</small></li>
          <li><small>terms & privacy</small></li>
          <li><small>Â© 2020 houzz</small></li>
        </ul>
      </footer>
    </Container>
  );
};
export default Footer;
